def minNumberOfFrogs(croakOfFrogs: str) -> int:
    """
    该算法的答案是正确的, 但是 leetcode 提交会超时
    变量解释:
    ======
    state数组维护一个字典, 代表 "对每个下一个即将到来的字母, 目前有哪些青蛙可以叫出这个字母"
    比如 state["a"] = [2, 42], 代表了 "当遇到一个字母 a, 我有2个青蛙可以叫他, 分别是2号和42号青蛙", 2和42是d字典的key值

    d字典维护了每个已经创建出来的青蛙的喊叫状态. 比如 d[131] = ["c", "r", "o"], 代表:
    131号青蛙目前已经喊了 cro 3个字母, 当下一个字母a来临时, 这个131号青蛙可以叫它.

    q 数组维护一个队列, 里面是 "当前空闲的青蛙", 当一个新的 "c" 字母来临时, 先看state有没有青蛙可以叫它, 如果没有, 再看
    q 里面有没有空闲青蛙, 如果也没有, 才会创建一个新青蛙, 并将这个新青蛙放到 state["c"] 中.

    示例数据:
    =========
    d = {1: [c, r], 2:[c], 3: [c, r, o], ..., 42: [c, r], ... ,131: [c, r ,o ,a]}
    state = {c: [], r: [2], o: [1, 42], a: [3], k: [131]}
    q(空闲青蛙队列) = [55, 62, 71]

    流程:
    1 初始化d / state
    2 遍历 croakOfFrogs, 对每一个字母s:
        step 1: 判断 state[s] 中是否有青蛙可以叫这个字母:
            a. 有 -> 拿出来作为 curr_frog
            b. 没有 -> 判断当前 s 是否等于 "c":
                等于"c" --> 创建新青蛙, 放入 state["c"] (之后让 d 从 state["c"] 中自己pop这个新青蛙出来)
                不等于 "c" --> 结束, 直接返回 -1. 示例字符串: "croakcroc", 遇到倒数第二个字母o时候没有青蛙能叫他, 而且无法
                              创建新青蛙, 所以结束.
        step 2: d从 state[s] 中pop出一个可用的青蛙, 作为 curr_frog, 进行处理:
            a. 比如当前curr_frog = 13, 也就是 "第13号青蛙", 那么假设 s="a",  d[13]=["c", "r", "o"], 那么
               写入完成后, d[13] 变成 [c, r, o ,a]
            b. 然后, 根据 next_map, 得到 "当前字母的下一个字母是啥", 比如s="c", 则 next_map["c"] == "r"
            c. 接着, 判断当前s是否是"k":
                <1> s=="k" --> 说明一个青蛙完成了一个完整 croak 叫喊, 他空闲了, 可以处理下一个 croak 了, 所以:
                    >> 先将当前的 d[curr_frog] = [] 初始化成空数组, 准备用来接受下一个 croak 叫喊.
                <2> s!="k" --> 没有什么特殊, 不做处理

            d. 将当前青蛙 curr_frog 放入 state["r"]中, 代表 "13号青蛙已经叫完c了, 他下次可以叫r了"
    """
    if croakOfFrogs[-1] != "k":
        return -1

    next_map = {"c": "r", "r": "o", "o": "a", "a": "k", "k": "c"}
    d = {1: []}
    state = {"c": [1], "r": [], "o": [], "a": [], "k": []}
    counter = {"c": 0, "r": 0, "o": 0, "a": 0, "k": 0}
    for i in range(len(croakOfFrogs)):
        s = croakOfFrogs[i]
        counter[s] += 1
        # step 1 挑青蛙 或者 创建新青蛙
        if len(state[s]) == 0:
            if s == "c":
                new_frog = max(d) + 1
                state["c"].append(new_frog)
            else:
                print("当前字母%s 没有任何青蛙可以叫他, state/q/d中都没有, 所以函数结束, 返回-1" % s)
                return -1

        # step 2 现在青蛙有了, 要让这个青蛙处理当前字母s
        curr_frog = state[s].pop()

        # (这里是新青蛙的特殊处理, 避免 KeyError)
        if curr_frog not in d:
            d[curr_frog] = []
        # 2.a
        d[curr_frog].append(s)
        # 2.b
        next_c = next_map[s]
        # 2.c
        if s == "k":
            d[curr_frog] = []
        # 2.d
        state[next_c].append(curr_frog)

    check_arr = list(counter.values())

    return len(d) if max(check_arr) == min(check_arr) else -1


def minNumberOfFrogs_v2(croakOfFrogs: str) -> int:
    """
    已提交 leetcode 并通过
    和v1的区别 - 删除d, 用 res代替, 避免大量的 append 和 pop 操作.
    只用 state 记录 "当前能处理各个字母的青蛙数量统计", 用 res 记录 "已有的青蛙总数"

    state = {"c": 3, "r": 1, "o": 5, "a": 0, "k": 1}
    代表:
    目前能处理 c 的青蛙有3只, 能处理r的青蛙有1只, 能处理o的青蛙有5只, 没有能处理a的青, 能处理k的青蛙有1只

    res = 4 代表 "已经使用的青蛙总数是4只"
    """
    if croakOfFrogs[-1] != "k":
        return -1

    next_map = {"c": "r", "r": "o", "o": "a", "a": "k", "k": "c"}
    res = 1
    state = {"c": 1, "r": 0, "o": 0, "a": 0, "k": 0}

    # counter 用来在最后判断是返回 res 还是 -1
    # 简单来说, 必须保证 5个字母的出现次数都完全相同, 否则直接返回 -1
    counter = {"c": 0, "r": 0, "o": 0, "a": 0, "k": 0}
    for i in range(len(croakOfFrogs)):
        s = croakOfFrogs[i]
        counter[s] += 1

        if state[s] == 0:
            if s == "c":
                # 创建新青蛙 (res+=1)
                res += 1
                state["c"] += 1
            else:
                print("当前字母%s 没有任何青蛙可以叫他, 所以函数结束, 返回-1" % s)
                return -1

        state[s] -= 1
        next_s = next_map[s]
        state[next_s] += 1

    # 如果 check_arr = [244, 244, 122, 33, 244], 那么返回-1
    # 如果 check_arr = [122, 122, 122, 122, 122], 每个字母出现次数都相同, 那么返回 res
    check_arr = list(counter.values())

    return res if max(check_arr) == min(check_arr) else -1


if __name__ == '__main__':
    # 标准答案 [2, 229, 16348, 16404]
    tests = [
        "ccrrooaakkcroacroakk",
        "",
        "",
        ""
    ]
    t = tests[0]

    r = minNumberOfFrogs_v2(t)
    print(r)
